#
# Complete the 'aOrB' function below.
#
# The function accepts following parameters:
#  1. INTEGER k
#  2. STRING a
#  3. STRING b
#  4. STRING c
#

def aOrB(k, a, b, c):
    '''
    LESSONS:
    - lstrip returns an empty string when the hex conversion result is 0x0, hence
      slicing the leading '0x' using [2:] is better
    - use map instead of defining one-liner functions
    '''

    # STEP 1: get binary representations
    binfill_len = 4 * max(map(len, [a, b, c]))
    A, B, C = map(lambda x: [*map(int, f'{int(x, 16):0>{binfill_len}b}')], [a, b, c])
      
    # STEP 2: modify A and B to fulfill A | B == C
    for i in range(binfill_len):
        if C[i]: # if 1
            if A[i] | B[i] == 0:
                k -= 1
                B[i] = 1
        else: # if 0
            if A[i] | B[i] == 1:
                k -= (A[i] + B[i])
                A[i], B[i] = 0, 0
        
        if k < 0:
            print(-1)
            return

    # THIS IS A SOLUTION BY SOMEONE ELSE FOR THIS STEP
    # it reduces the number of IF checks per iteration
    # for x, y, z in zip(a_bin, b_bin, c_bin):
    #     if (x | y) ^ z == 1: # very clever! only do something when A and B bit differs from the C bit
    #         if (x | y) == 0:
    #             y = 1  # only change bit in b, to keep a' minimal
    #             k -= 1
    #         else:
    #             k -= x+y
    #             x, y = 0, 0

    # STEP 3: further minimize A while there's remaining k
    i = 0
    while i < binfill_len:
        if k == 0:
            break
        if A[i] and B[i]: # (1, 1) - both 1s
            A[i] = 0
            k -= 1
        elif A[i] and not B[i] and k > 1: # (1, 0) - A is 1 and B is 0
            A[i], B[i] = 0, 1
            k -= 2
        i += 1

    # STEP 4: output result
    A, B = map(lambda x: ''.join(map(str, x)), [A, B])       # convert to binary string
    A, B = map(lambda x: hex(int(x, 2))[2:].upper(), [A, B]) # convert to hex string
    
    print(A)
    print(B)

'''
helper functions used in earlier tries
'''
def getBinFromHex(h):
    return bin(int(h, 16)).lstrip('0b')

def getHexFromBin(b):
    return hex(int(b, 2)).lstrip('0x').upper()
    
def appendZeros(arr, fill_len):
    for _ in range(len(arr), fill_len):
        arr.append('0')

